-- Add missing Kofax batch records to staging table.

/* Extract data from Excel "IN MFD - Missing from MFB" sheet (4320 lines) and create insert into Mail Fax Batch staging table.
 - Create new column with formula
   = CONCATENATE("RBK1",$A4293,"RBK2",ROW() - 1,"RBK3",TEXT($E4293,"YYYY-MM-DD HH:MM"),"RBK4",TEXT($F4293,"YYYY-MM-DD HH:MM"),"RBK5")
   
 - Copy new calculated column to Oracle SQL Developer.
  Example: RBK1NYSOH-FAX2015-03-18-00-13-13-0RBK21RBK32015-03-18 00:14RBK42015-03-20 10:41RBK5

 - Use Oracle SQL Developer replace to globally replace RBK* with insert SQL syntax.
  Example: insert into TEST_RBK_CEMBS values('NYSOH-FAX2015-03-18-00-13-13-0',1,to_date('2015-03-18 00:14','YYYY-MM-DD HH24:MI'),to_date('2015-03-20 10:41','YYYY-MM-DD HH24:MI'));

  - Create temporary table to hold batch data.
  create table TEST_RBK_CEMBS (BATCH_NAME varchar2(255),BATCH_ID number,CREATE_DT date,COMPLETE_DT date);
  
  - Extract batch data in form of insert statement for Mail Fax Batch staging table.  Generate BATCH_GUID.
  select 
    'insert into CORP_ETL_MFB_BATCH_STG (BATCH_GUID,BATCH_ID,BATCH_NAME,CREATION_STATION_ID,CREATION_USER_NAME,CREATION_USER_ID,BATCH_CLASS,CREATE_DT,COMPLETE_DT,INSTANCE_STATUS,INSTANCE_STATUS_DT,BATCH_PAGE_COUNT,BATCH_DOC_COUNT,BATCH_ENVELOPE_COUNT,ASF_SCAN_BATCH,CLASSIFICATION_DT,RECOGNITION_DT,VALIDATION_DT,ASF_POPULATE_REPORTS,ASSD_POPULATE_REPORTS,ASED_POPULATE_REPORTS,ASF_RELEASE_DMS,ASSD_RELEASE_DMS,ASED_RELEASE_DMS,BATCH_PRIORITY,STG_DONE_DATE,STG_EXTRACT_DATE,STG_LAST_UPDATE_DATE,STG_PROCESSED_DATE,INSERT_UPDATE,STG_INSERT_JOB_ID,BATCH_COMPLETE_DT,CURRENT_STEP,SOURCE_SERVER) 
    values (' || lower(regexp_replace(sys_guid(),'(........)(....)(....)(....)(............)','''{\1-\2-\3-\4-\5}''')) || ',' || BATCH_ID || ',''' || BATCH_NAME || ''',1,''Randall Kolb'',''Randall Kolb'',''' || case substr(BATCH_NAME,1,9) when 'NYSOH-FAX' then 'NYSOH-FAX' else 'NYSOH-MAIL' end || ''',to_date(''' || CREATE_DT || ''',''YYYY-MM-DD HH24:MI:SS''),null,''Active'',sysdate,null,null,null,''Y'',null,null,null,''N'',null,null,''N'',null,null,1,sysdate,sysdate,sysdate,sysdate,''I'',5,null,''Scan Batch'',''Central'');'
  from TEST_RBK_CEMBS
  order by CREATE_DT asc;

  - Remove double quotes from start and end of result via Oracle SQL Developer replace.
  
  - Manually add commit every 1000 inserts.
*/

